webpackJsonp([0x29dae87d6a713a00],{"../../../work/landr/packages/landr/node_modules/json-loader/index.js!./.cache/json/docs-how-it-works.json":function(n,e){n.exports={data:{repo:{html_url:"https://github.com/resin-io/landr"},markdownRemark:{timeToRead:2,html:'<h2 id="under-the-hood"><a href="#under-the-hood" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Under the hood</h2>\n<p>The idea of landr is pretty simple it take’s a git repo, assumes some conventions and from those conventions, it churns out a static website. We didn’t want to build another static site generator so we use <a href="https://www.gatsbyjs.org/docs/">gatsby</a> to do the heavy lifting, gatsby is only responsible for gathering data and abstracting a lot of the standard setup required for a gatsby project.</p>\n<h2 id="packages"><a href="#packages" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Packages</h2>\n<p>Landr is built in a module style, as many of the packages may be useful in other contexts.</p>\n<ul>\n<li>\n<p>landr</p>\n<ul>\n<li>core set of modules for parsing configuration and providing api for landr-cli.</li>\n<li>currently the root directory of where the site is built from (this may change)</li>\n</ul>\n</li>\n<li>\n<p>gatby-transformer-readme</p>\n<ul>\n<li>Adds readme object <code>readme-parser</code> to graphql server so that it can be queried from templates</li>\n</ul>\n</li>\n<li>\n<p>gatby-transformer-changelog</p>\n<ul>\n<li>Adds changelog object <code>readme-changelog</code> to graphql server so that it can be queried from templates</li>\n</ul>\n</li>\n<li>\n<p>gatsby-plugin-landr</p>\n<ul>\n<li>holds <code>layouts</code>, <code>pages</code>, and <code>components</code>. All of which are react components.</li>\n<li>add landr specific webpack config</li>\n<li>adds landr specific pages</li>\n</ul>\n</li>\n<li>\n<p>gatsby-source-github</p>\n<ul>\n<li>pulls repo data from the github api.</li>\n</ul>\n</li>\n</ul>\n<h3 id="getting-data"><a href="#getting-data" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Getting data</h3>\n<h3 id="github-api"><a href="#github-api" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Github API</h3>\n<p>TODO</p>\n<h4 id="readme"><a href="#readme" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Readme</h4>\n<p>We parse you README.md into a query-able object.   </p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token punctuation">{</span>\n  title<span class="token punctuation">,</span> <span class="token comment" spellcheck="true">// First heading in file</span>\n  lead<span class="token punctuation">,</span> <span class="token comment" spellcheck="true">// First &lt;p> in file</span>\n  features <span class="token punctuation">{</span> <span class="token comment" spellcheck="true">// First heading that matches \'features\'</span>\n    title<span class="token punctuation">,</span>\n    content <span class="token comment" spellcheck="true">// all content from the heading to the next heading of the same level</span>\n  <span class="token punctuation">}</span>\n  install <span class="token punctuation">{</span> <span class="token comment" spellcheck="true">// First heading that matches one of [ \'install\', \'getting started\', \'quick start guide\' ]</span>\n    title<span class="token punctuation">,</span>\n    content <span class="token comment" spellcheck="true">// all content from the heading to the next heading of the same level</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  contribute <span class="token punctuation">{</span>  <span class="token comment" spellcheck="true">// First heading that matches one of [ \'contrib\', \'get involved\']</span>\n    title<span class="token punctuation">,</span>\n    content <span class="token comment" spellcheck="true">// all content from the heading to the next heading of the same level</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  license <span class="token punctuation">{</span> <span class="token comment" spellcheck="true">// First heading that matches one of [ \'license\' ]</span>\n   title\n   content <span class="token comment" spellcheck="true">// all content from the heading to the next heading of the same level</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<h3 id="changelog"><a href="#changelog" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Changelog</h3>\n<p>We parse you CHANGELOG.md into a query-able object. It’ll pull every h2 and it’s child content into a any entry.</p>\n<div class="gatsby-highlight">\n      <pre class="language-graphql"><code><span class="token punctuation">{</span>\n  entries <span class="token punctuation">[</span>\n    <span class="token punctuation">{</span>\n      title<span class="token punctuation">,</span>\n      content\n    <span class="token punctuation">}</span>\n    <span class="token operator">...</span>\n  <span class="token punctuation">]</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>',fileAbsolutePath:"/Users/gaudi/work/landr/docs/how-it-works.md"}},pathContext:{title:"How It Works",slug:"/docs/how-it-works"}}}});
